import { Input, Col, Row } from 'antd';
import './styleJobOpening.css';

function jobOpening(props) {
  const { Search } = Input;
  return (
    <div className="jopOpenings-body">
      <div className="jopOpenings-header">
        <h3>Job openings</h3>
      </div>

      

      <Row gutter={[0, 16]}>
        <Col
          xs={{ span: 7, offset: 1 }}
          sm={{ span: 6, offset: 1 }}
          md={{ span: 7, offset: 1 }}
          lg={{ span: 7, offset: 1 }}
        >

            
        </Col>
      </Row>

      {/* <div className="jobOpenings-result">dgiu</div> */}
    </div>
  );
}

export default jobOpening;
